import React from "react";

export const ContactForm = ({
  name,
  setName,
  phoneNumber,
  setPhoneNumber,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <>
      <form onSubmit = {handleSubmit}>
        <label for = 'name'>Enter name: </label>
        <input  id = 'name' type = 'text' name = 'name' value = {name} onChange = {setName} />
        <label for = 'phone'>Enter name: </label>
        <input id = 'phone' type = 'text' name = 'phone' value = {phoneNumber} onChange = {setPhoneNumber} />
        <label for = 'email'>Enter name: </label>
        <input id = 'email' type = 'text' name = 'email' value = {email} onChange = {setEmail} />
        <input type = 'submit' value = 'submit' />
      </form>
    </>
  );
};
